import React from "react";
import "./App.css";
import Wrapper from "./components/Wrapper";
import Navbar from "./components/Navbar";
import SearchForm from "./components/SearchForm";
import Container from "./components/Container";
import Table from "./components/Table";

function App() {
  const [modalShow, setModalShow] = React.useState(false);
  const employees = [
    {
      name: "Norman Lei",
      gender: "Male",
      email: "normanlei0901@gmail.com",
      phone: "(206)349-3478",
      department: "Full-Stack"
    },
    {
      name: "Wenfu Lei",
      gender: "Male",
      email: "normanlei@gmail.com",
      phone: "(206)349-3477",
      department: "Full-Stack"
    },
    {
      name: "Yvonne Chen",
      gender: "Female",
      email: "xinyachen@gmail.com",
      phone: "(206)388-3478",
      department: "Front-end"
    },
    {
      name: "Xinya Chen",
      gender: "Female",
      email: "yvonnechen@gmail.com",
      phone: "(206)529-3478",
      department: "Back-end"
    },
    {
      name: "Mike Jack",
      gender: "Male",
      email: "jackmike@gmail.com",
      phone: "(206)349-9191",
      department: "Front-end"
    },
  ];
  const columns = React.useMemo(
    () => [
      {
        Header: 'Name',
        accessor: 'name',

      },

          {
            Header: 'Gender',
            accessor: 'gender',
          },
          {
            Header: 'Email',
            accessor: 'email',
          },
          {
            Header: 'Phone',
            accessor: 'phone',
          },
          {
            Header: 'Department',
            accessor: 'department',
          },
        ],
    []
  );
  const [data, setData] = React.useState(employees);

  return (
    <Wrapper>
      <Navbar modalShow={modalShow} setModalShow={setModalShow}></Navbar>
      <Container>
        <SearchForm data={data} setData={setData}></SearchForm>
        <Table columns={columns} data = {employees}></Table>
      </Container>
    </Wrapper>
  );
}


export default App;
